// onboarding.page.ts
import { Component } from "@angular/core";
import { Router } from "@angular/router";
import { FormBuilder, FormGroup, Validators } from "@angular/forms";
import { DataSharingService } from "../../../services/data-sharing.services";
import { Globals } from "../../../services/globals";
import { ToastController } from "@ionic/angular";
import axios from "axios";
import { Product } from "../../../services/globals";
import { CartService } from "../../../services/cart/cart.service";
import { Subscription } from "rxjs";
import { OrderService } from "../../../services/order/order.service";
import { AuthService } from "src/app/services/auth/auth.services";

@Component({
  selector: "app-onboarding",
  templateUrl: "./onboarding.page.html",
  styleUrls: ["./onboarding.page.scss"],
})
export class OnboardingPage {
  onboardingForm: FormGroup;
  cartItems: Array<Product> = [];

  constructor(
    private router: Router,
    private fb: FormBuilder,
    private dataSharingService: DataSharingService,
    private toastController: ToastController,
    private cartService: CartService,
    public authServices: AuthService,
    private orderServices: OrderService
  ) {
    this.onboardingForm = this.fb.group({
      city: ["", Validators.required],
      area: ["", Validators.required],
      building: ["", Validators.required],
      flatNumber: ["", Validators.required],
      floor: ["", Validators.required],
    });
    this.cartItems = this.cartService.getCartItems();
  }

  ngOnInit() {
    if (this.authServices.isAuthenticated()) {
      this.onboardingForm.patchValue({
        city: localStorage.getItem("city"),
        area: localStorage.getItem("area"),
        building: localStorage.getItem("building"),
        flatNumber: localStorage.getItem("flatNumber"),
        floor: localStorage.getItem("floor"),
      });
    }
  }

  redirectToPaymentPage() {
    const formData = this.onboardingForm.value;
    //console.log("cartItems", this.cartItems);
    this.dataSharingService.setFormData(formData);
    console.log(this.dataSharingService.getFormData());
    this.router.navigate(["/tabs/payment"]);
  }
}
<!-- onboarding.page.html -->
<ion-content class="custom-content">
  <div class="pageWrapper">
    <div class="topWrapper"></div>
    <div class="bottomWrapper">
      <div class="pageHeading ion-padding">
        <h1>Enter<br /> <span>Your Delivery Address!</span></h1>
      </div>

      <div class="pageRow ion-padding-horizontal">
        <form [formGroup]="onboardingForm">
          <ion-select placeholder="Select City" class="ion-margin-bottom" formControlName="city">
            <ion-select-option value="Lucknow">Lucknow</ion-select-option>
            <ion-select-option value="Kanpur">Kanpur</ion-select-option>
            <ion-select-option value="Delhi">Delhi</ion-select-option>
          </ion-select>
          <ion-select placeholder="Select Local Area" class="ion-margin-bottom" formControlName="area">
            <ion-select-option value="Sector-10">Sector-10</ion-select-option>
            <ion-select-option value="Sector-11">Sector-11</ion-select-option>
            <ion-select-option value="Sector-12">Sector-12</ion-select-option>
          </ion-select>
          <ion-select placeholder="Select Building/Apartment" class="ion-margin-bottom" formControlName="building">
            <ion-select-option value="Amaatra Homes">Amaatra Homes</ion-select-option>
            <ion-select-option value="Sangam Homes">Sangam Homes</ion-select-option>
            <ion-select-option value="Mahagun Mantraa">Mahagun Mantraa</ion-select-option>
          </ion-select>
          <div class="ion-padding-top">
            <h3>Address</h3>
            <ion-input type="number" placeholder="Enter Flat/House Number" class="ion-margin-bottom" formControlName="flatNumber"></ion-input>
            <ion-select placeholder="Select Floor" formControlName="floor">
              <ion-select-option value="1">1</ion-select-option>
              <ion-select-option value="2">2</ion-select-option>
              <ion-select-option value="3">3</ion-select-option>
            </ion-select>

            <ion-button
              expand="block"
              class="ion-padding-bottom ion-margin-top"
              (click)="redirectToPaymentPage()"
            >Continue</ion-button>
          </div>
        </form>
      </div>
    </div>
  </div>
</ion-content>
